// markup open
add_action( 'genesis_header', 'custom_header_markup_open', 5 );
function custom_header_markup_open() {
    genesis_markup( array(
        'html5'   => '<header id="masthead" %s>',
        'context' => 'site-header navbar-static-top navbar-light',
    ) );
    genesis_structural_wrap( 'header' );
}


